'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendCloseAllPositionsCommand extends SendSingleCommandWithoutResponse {
    closeAllPositionsRequest;
    timeController;
    descriptors;
    constructor() {
        super();
        this.commandName = "SendCloseAllPositionsCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createCloseAllPositionsMessage(this.tradingSession, this.closeAllPositionsRequest, this.descriptors, this.requestNumberGenerator, stdlib.nowutc(), this.timeController);
    }
}
module.exports = SendCloseAllPositionsCommand
